import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../../components/Navbar";
import "./rtform.css"; // Ensure the CSS file is correct

function RtReg() {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");  // ✅ Store email
  const [shopName, setShopName] = useState("");
  const [ownerName, setOwnerName] = useState("");
  const [mobileNumber, setMobileNumber] = useState("");
  const [storeAddress, setStoreAddress] = useState("");
  const [error, setError] = useState("");  // ✅ Fix the missing `setError`

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError(""); // ✅ Reset error before submission

    console.log("Sending data:", {
      email,
      store_name: shopName,
      owner_name: ownerName,
      mobile_number: mobileNumber,
      store_address: storeAddress,
    });

    try {
      const response = await fetch("http://127.0.0.1:8000/api/register-retailer/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          email: email,  // ✅ Ensure email is sent
          store_name: shopName,
          owner_name: ownerName,
          mobile_number: mobileNumber,
          store_address: storeAddress,
        }),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.error || "Registration failed.");
      }

      alert("Retail Seller Registration successful! Awaiting admin approval.");
      navigate("/login");  // ✅ Redirect to login after registration
    } catch (error) {
      console.error("Registration failed:", error);
      setError(error.message);  // ✅ Fix setError usage
    }
  };

  return (
    <>
      <Navbar />
      <div className="rtreg-signup_container">
        <div className="rtreg-image_container">
          <img src="/Images/side-image_(1).jpg" alt="Decorative" />
        </div>
        <div className="rtreg-signup_box">
          <div className="rtreg-signup_form">
            <div className="text">Registration</div>
            {error && <p className="error_message">{error}</p>} {/* ✅ Show errors */}
            <form onSubmit={handleSubmit}>
              <div className="rtreg-input_elements">
                <div className="rtreg-input_items">
                  <img src="/Images/email_icon.png" alt="Email Icon" />
                  <input 
                    type="email" 
                    placeholder="Email" 
                    value={email} 
                    onChange={(e) => setEmail(e.target.value)} 
                    required 
                  />
                </div>
                <div className="rtreg-input_items">
                  <img src="/Images/shop_icon.png" alt="Shop Icon" />
                  <input 
                    type="text" 
                    placeholder="Shop name" 
                    value={shopName} 
                    onChange={(e) => setShopName(e.target.value)} 
                    required 
                  />
                </div>
                <div className="rtreg-input_items">
                  <img src="/Images/owner_icon.png" alt="Owner Icon" />
                  <input 
                    type="text" 
                    placeholder="Owner name" 
                    value={ownerName} 
                    onChange={(e) => setOwnerName(e.target.value)} 
                    required 
                  />
                </div>
                <div className="rtreg-input_items">
                  <img src="/Images/phone_icon.png" alt="Phone Icon" />
                  <input 
                    type="number" 
                    placeholder="Mobile number" 
                    value={mobileNumber} 
                    onChange={(e) => setMobileNumber(e.target.value)} 
                    required 
                  />
                </div>
                <div className="rtreg-input_items">
                  <img src="/Images/address_icon.png" alt="Address Icon" />
                  <textarea 
                    placeholder="Store Address"
                    value={storeAddress}
                    onChange={(e) => setStoreAddress(e.target.value)}
                    required  
                    className="rtreg-address-input"
                  />
                </div>
              </div>
              <div className="submit-container">
                <button type="submit" className="submit">Register</button>
              </div>
            </form>
            <div className="links">
              <a href="/login">Already have an account? Login</a>
              <br />
              <a href="/forgot-password">Forgot Password?</a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default RtReg;
